ops\":{\"deltaDeltaValue\":[{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":1}},{\"insert\":\"智利圣何塞酒庄(中国)代表处 \",\"attributes\":{\"color\":\"#ffffff\",\"bold\":true}},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":1}},{\"insert\":\"暨 \",\"attributes\":{\"color\":\"#ffffff\",\"bold\":true}},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":1}},{\"insert\":\"圣拉蒙贸易(武汉)有限公司 \",\"attributes\":{\"color\":\"#ffffff\",\"bold\":true}},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":1}}],\"readOnly\":false}}]},{\"native\":false,\"nodeName\":\"VerticalGrid\",\"children\":[{\"native\":false,\"nodeName\":\"ImageArea\",\"props\":{\"alt\":\"initial\",\"src\":\"http://blog-src.b0.upaiyun.com/taohe/dev/editPage/administrator/1/template/8/cc9c0431bbd65720ef0f2e2da2f4820c\"}}]}]},{\"native\":false,\"nodeName\":\"VerticalLayout\",\"props\":{\"backgroundInfo\":{\"background\":\"white\",\"backgroundType\":\"pureColor\",\"imageInfo\":{},\"fillType\":null,\"enableParallex\":null},\"id\":\"VerticalLayout_3d7ff068902299b8c9d8cc70d95695ba\",\"flex\":[6,6]},\"layoutName\":\"纵向布局\",\"children\":[{\"native\":false,\"nodeName\":\"VerticalGrid\",\"children\":[{\"native\":false,\"nodeName\":\"TextArea\",\"props\":{\"deltaDeltaValue\":[{\"insert\":\"智利葡萄酒的名片\",\"attributes\":{\"bold\":true}},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":1}},{\"insert\":\"Chile Wine \",\"attributes\":{\"bold\":true}},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":1}},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\"}},{\"insert\":\"圣拉蒙贸易(武汉)有限公司是智利圣何 塞酒庄(San Jose de Apalta)在中国设立的代表 处及全职能市场销售公司，代表酒庄在中国市 场进行圣拉蒙(San Ramon)品牌和圣何塞(San Jose de Apalta)品牌的推广、产品营销和市场开发的 活动。公司坚持做专业的智利葡萄酒运营商， 坚持把智利葡萄酒做精做细，对智利葡萄酒的 特点进行精确的把控，所推广的葡萄酒产品曾 多次在国际品鉴大赛中获得金奖和国际著名酒 评人的高酒评分。公司所属的圣何塞酒庄创立 于1970年，隶属于智利前三大农业集团Agricola Santa Cristina Group，集团拥有400公顷的葡萄种 植园和600公顷的农庄果园，主营智利葡萄酒、 智利车厘子等具有智利特色代表的农产品，地 处智利著名的中央山谷里面的拉佩尔谷(Rapel Valley)的阿帕塔产区(Apalta)，世界90%以上 的佳美娜葡萄出产于此地，该产区以出产智利 的顶级佳美娜葡萄酒而闻名于世。 \"},{\"insert\":\"\\n\",\"attributes\":{\"header\":2}},{\"insert\":\"\\n\\n\"},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\"}}],\"readOnly\":false}}]},{\"native\":false,\"nodeName\":\"VerticalGrid\",\"children\":[{\"native\":false,\"nodeName\":\"ImageArea\",\"props\":{\"alt\":\"initial\",\"src\":\"http://blog-src.b0.upaiyun.com/taohe/dev/editPage/administrator/1/template/8/1bfc866e43dafb3ebc77ea0c1082fa9c\"}}]}]},{\"native\":false,\"nodeName\":\"VerticalLayout\",\"props\":{\"backgroundInfo\":{\"background\":\"white\",\"backgroundType\":\"pureColor\",\"imageInfo\":{},\"fillType\":null,\"enableParallex\":null},\"id\":\"VerticalLayout_48628806d570d91a1705b4d64eddb33f\",\"flex\":[6,6]},\"layoutName\":\"纵向布局\",\"children\":[{\"native\":false,\"nodeName\":\"VerticalGrid\",\"children\":[{\"native\":false,\"nodeName\":\"TextArea\",\"props\":{\"deltaDeltaValue\":[{\"insert\":\"圣何塞酒庄 \",\"attributes\":{\"size\":\"large\",\"bold\":true}},{\"insert\":\"\\n\",\"attributes\":{\"header\":2}}],\"readOnly\":false}},{\"native\":false,\"nodeName\":\"ImageArea\",\"props\":{\"alt\":\"initial\",\"src\":\"http://blog-src.b0.upaiyun.com/taohe/dev/editPage/administrator/1/template/8/2c062dacd3b1e7e9effa785298edc857\"}}]},{\"native\":false,\"nodeName\":\"VerticalGrid\",\"children\":[{\"native\":false,\"nodeName\":\"TextArea\",\"props\":{\"deltaDeltaValue\":[{\"insert\":\"圣何塞阿帕塔 \"},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":2}},{\"insert\":\"(San Jose de Apalta)\"},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":2}},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\"}},{\"insert\":\"  坐落智利首都圣地亚哥旁140公里处的圣 何塞阿帕塔(San Jose de Apalta)酒庄，创立 于智利葡萄酒业技术快速发展的1970年，成立 初期以家族经营的模式致力于栽种精细的葡萄， 直至1994年，以丰富热情的栽植经验与专业酿 酒知识，以“执着完美”的精神开始生产高品 质且风格独具的葡萄酒。庄园的家族葡萄园位 于智利中部的拉佩尔谷产区(Rapel Valley)， 向来以独特的土壤及气候闻名。承袭家族经营 的方式使园内每一株葡萄树叶皆由人工细心及 完善地照顾，其超过30年树龄的枝藤更蕴育出 多种极具收藏价值的珍酿。总年产量约320万 升，至今已成功行销全球各地，成为智利葡萄 酒外销酒庄的翘楚之一，并赢得顶级葡萄酒的 美誉。  \"},{\"insert\":\"\\n\",\"attributes\":{\"header\":2}}],\"readOnly\":false}}]}]},{\"native\":false,\"nodeName\":\"VerticalLayout\",\"props\":{\"backgroundInfo\":{\"background\":\"url(http://blog-src.b0.upaiyun.com/taohe/dev/editPage/administrator/1/template/8/1e59b831cea08d6cb87f0e331fe2cb61)\",\"backgroundType\":\"image\",\"imageInfo\":{\"width\":1712,\"height\":294},\"fillType\":\"stretch\",\"enableParallex\":true},\"id\":\"VerticalLayout_cc9cf35ab755bbd1fe6c901143e6b7b6\",\"flex\":[12]},\"layoutName\":\"纵向布局\",\"children\":[{\"native\":false,\"nodeName\":\"VerticalGrid\",\"children\":[{\"native\":false,\"nodeName\":\"TextArea\",\"props\":{\"deltaDeltaValue\":[{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":1}}],\"readOnly\":false}}]}]},{\"native\":false,\"nodeName\":\"VerticalLayout\",\"props\":{\"backgroundInfo\":{\"background\":\"#483d85\",\"backgroundType\":\"pureColor\",\"imageInfo\":{},\"fillType\":null,\"enableParallex\":null},\"id\":\"VerticalLayout_a98ac090c039c9fc45e4e393460e3c92\",\"flex\":[12]},\"layoutName\":\"纵向布局\",\"children\":[{\"native\":false,\"nodeName\":\"VerticalGrid\",\"children\":[{\"native\":false,\"nodeName\":\"TextArea\",\"props\":{\"deltaDeltaValue\":[{\"insert\":\"圣何塞阿帕塔酒庄葡萄酒生产基地 \",\"attributes\":{\"bold\":true}},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":1}},{\"insert\":\"The Wine Production Factory \",\"attributes\":{\"size\":\"large\",\"bold\":true}},{\"insert\":\"\\n\",\"attributes\":{\"align\":\"center\",\"header\":3}}],\"readOnly\":false}}]}]},{\"native\":false,\"nodeName\":\"VerticalLayout\",\"props\":{\"backgroundInfo\":{\"background\":\"#ffffff\",\"backgroundType\":\"pureColor\",\"imageInfo\":{},\"fillType\":null,\"enableParallex\":null},\"id\":\"VerticalLayout_90ae6bebc1338ee7d8050079710b072a\",\"flex\":[4,4,4]},\"layoutName\":\"纵向布局\",\"children\":[{\"native\":false,\"nodeName\":\"VerticalGrid\",\"children\":[{\"native\":false,\"nodeName\":\"